# Define a function to validate submissions
def validate_submissions(submissions):
    valid_submissions = []
    invalid_submissions = []
    for submission in submissions:
        if submission:
            valid_submissions.append(submission)
        else:
            invalid_submissions.append(submission)
    return valid_submissions, invalid_submissions


